    "2013-03-19T00:31:08.867542",nt"name": "geochemical-trace-element-and-rare-earth-element-data-from-stream-sediment-and-pan-concentrate-",nt"isopen":
    false,nt"url": null,nt"notes": "Mineral-resources personnel from the Alaska
    Division of Geological & Geophysical Surveys conducted reconnaissance stream-sediment
    and pan-concentrate sampling in the Melozitna Mining District, Tanana and Melozitna
    quadrangles, from July 25 to August 13, 2011. This helicopter-supported sampling
    project was part of a statewide assessment of Alaska's potential for rare-earth
    element (REE) mineralization, and was funded by the Rare Earth Elements and Strategic
    Minerals Assessment capital improvement project. During this field project, 32 stream
    sediment and 28 heavy-mineral pan concentrate samples were collected for geochemical
    analysis (geochemical trace elements and rare earth elements). An additional historic
    U.S. Bureau of Mines sample from the area was also analyzed as part of this report.
    Highlights of the DGGS sampling project include documenting new gold-bearing drainages
    and identifying several samples with high REE values.",nt"license_title": null,nt"extras":
